import React from 'react';
import PropTypes from 'prop-types';
import Link from 'next/link';
import { Menu } from 'antd';
import Logo from '../pages/public/images/PocketVaccineLogo.png';

const AppLayout = ({ children }) => {
    return(
        <div>
            <div style={{textAlign:'center'}}>
                <img src={Logo} alt="logo" width="400px" height="50" padding="5px 0 5px 0"/>
            </div>
            <Menu mode="horizontal" style={{width: '30%', margin:'0 auto'}}>
                <Menu.Item >
                    <Link href="/"><a>커뮤니티</a></Link>
                </Menu.Item>
                <Menu.Item>
                    <Link href="/vaccinegraph"><a>살펴보기</a></Link>
                </Menu.Item>
                <Menu.Item>
                    <Link href="/vaccinestatus"><a>접종현황</a></Link>
                </Menu.Item>
                <Menu.Item>
                    <Link href="/mypage"><a>마이</a></Link>
                </Menu.Item>
            </Menu>
            {children}
        </div>
    );
}

AppLayout.proTypes = {
    children : PropTypes.node.isRequired,
}

export default AppLayout;
